const About = () => {
  return (
    <div>
      <h3 className="text-center my-3">About Us</h3>
      <p>This news website is dedicated to providing up-to-date news articles from various reliable sources. Our goal is to keep you informed about the latest happenings in different domains.</p>
    </div>
  );
};

export default About;
